import React, { Component } from 'react';

import {
  BrowserRouter as Router,
  Route,
  Redirect
} from "react-router-dom";
import { NavBar } from '../components'
import { Login, Admin, OrdersHistory, Home, ManageUsers, Register } from '../pages'

const fakeAuth = {
 isAuth:false,
 auth(cb) {
   this.isAuth = true
   setTimeout(cb,100)
 },
  signOut(cb) {
    this.isAuth = false
    setTimeout(cb,100)
  }
}

    const privateRoute=({component:Component, ...rest})=>{
      <Route {...rest} render={() =>{
        fakeAuth.isAuth === true
      }}

      />
    }
class App extends Component {
  render() {
    return (

      <Router>
        <Route exact path="/">
          <Login />
        </Route>

        <Route exact path="/home">
        <NavBar> 
        </NavBar>
          <Home />
        </Route>

        <Route exact path="/admin">
        <NavBar> 
        </NavBar>
          <Admin path="../pages" />
        </Route>

        <Route exact path="/admin/register">
        <NavBar> 
        </NavBar>
          <Register path="../pages" />
        </Route>

        <Route exact path="/admin/ManageUsers">
        <NavBar> 
        </NavBar>
          <ManageUsers path="../pages" />
        </Route>
        <Route exact path="/admin/ordershistory">
        <NavBar> 
        </NavBar>
          <OrdersHistory path="../pages" />
        </Route>

      </Router>
    )
  }
}
export default App
